    'content' => '<p><strong> Стеновой керамзитобетонный блок 390×290×188 мм М100</strong> – это строительный блок большого размера изготовленного из легкого керамзитобетона. Точная геометрия и соблюдение всех требований ГОСТа при производстве на современном оборудовании, позволяет ускорить процесс строительства, экономить на отделочных материала, гарантировать высокое качества строителства. Керамзитобетонный блок содержит пустоты в общем объеме до 28%, что позволяет их использовать как технологические ниши.</p>
<p>Керамзит образуется в процессе обжига гранул глины. В результате чего получается прочный, легкий, пористый материал.</p>
<p><a title="Блоки керамзитобетонные" href="products/bloki/">Блоки керамзитобетонные</a> уже давно с успехом заменяют тяжелый бетон в масштабных конструкциях. Благодаря своему малому весу они значительно облегчают не только работу с ними, но и существенно снижают нагрузку на фундамент сооружения. Он широко применяется не только для возведения зданий, но и в строительстве мостов. Так как данный блок имеет отличную устойчивость к любым погодным условиям и влажности воздуха.</p>
<p>Его стоимость значительно ниже других строй материалов, что дает возможность сэкономить без ущерба для качества постройки.</p>',
